import React from 'react'; 
import './App.css';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import Home from './components/pages/Home';
import About from './components/pages/About';


function App() {
  return (
    <div className="App">
      <div className="container">
      <h1>Hello World</h1>
      </div>
      <Home />
      <About />

    </div>
  );
}

export default App;
